import React from "react";
import Dialog from "@material-ui/core/Dialog";
import CloseIcon from "@material-ui/icons/Close";
import Fab from "@material-ui/core/Fab";
import GalleryAppBar from "../components/GalleryAppBar";
import Slide from "@material-ui/core/Slide";

export default function ImageDialog({ handleCloseToParent, bigImageUrl }) {
  const handleClose = () => {
    handleCloseToParent();
  };

  const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
  });

  return (
    <Dialog
      fullScreen
      open={true}
      onClose={handleClose}
      TransitionComponent={Transition}
    >
      <GalleryAppBar></GalleryAppBar>
      <img
        src={bigImageUrl}
        alt={bigImageUrl}
        style="width:50%;height:100%;object-fit:cover;"
      />
      <Fab color="primary" aria-label="Close" onClick={() => handleClose()}>
        <CloseIcon />
      </Fab>
    </Dialog>
  );
}
